import React, { useState } from 'react';
import Images from '../src/screen/ImageList'
import {Provider} from 'react-redux'
import {PersistGate} from 'redux-persist/integration/react'
import storeConfig from './redux/store'
import {useStore} from 'react-redux'
import Loading from './components/Loading'
import NoItem from './components/NoItem';
import imageListThunk from './redux/action/imageListActionThunk';


function App() {
  const auth = storeConfig.auth
  console.log(auth)

  let loginAndLogout = (<div>
    <li className="login">Login</li>
    <li className="signup">Signup</li> 
  </div>)


  //const store = storeConfig().store
  const persistor = storeConfig().persistor
  return (
    <Provider store={store}>
    <PersistGate loading={<Loading />} persistor={persistor}>
      <nav className='nav-wrapper'>
        <ul>
          <li>gidiShare</li>
          {false ? <li className="logout">Logout</li> : loginAndLogout}
        </ul>
      </nav>
      <Images />
    </PersistGate>
  </Provider>
  )
}

export default App;
